PROBLEM TYPE:
  PROBLEMTYPE: Structure
IO:
  OUTPUT_SPRING: true
  STRUCT_STRESS: Cauchy
  STRUCT_STRAIN: Yes
  WRITE_INITIAL_STATE: false
  WRITE_FINAL_STATE: true
  VERBOSITY: standard
IO/RUNTIME VTK OUTPUT:
  INTERVAL_STEPS: 5
IO/RUNTIME VTK OUTPUT/STRUCTURE:
  OUTPUT_STRUCTURE: true
  DISPLACEMENT: true
  ELEMENT_OWNER: true
  STRESS_STRAIN: true
SOLVER 1:
  SOLVER: Superlu
  NAME: Structure_Solver
STRUCTURAL DYNAMIC:
  INT_STRATEGY: Standard
  DYNAMICTYPE: Statics
  PRESTRESS: Material_Iterative
  PRESTRESSTIME: 100
  PRESTRESSTOLDISP: 1e-15
  RESULTSEVERY: 5
  RESTARTEVERY: 5
  TIMESTEP: 0.1
  NUMSTEP: 1000
  MAXTIME: 100
  TOLDISP: 1e-09
  TOLRES: 1e-09
  LOADLIN: true
  LINEAR_SOLVER: 1
MATERIALS:
  - MAT: 1
    MAT_IterativePrestress:
      MATID: 11
      ACTIVE: true
  - MAT: 11
    MAT_Struct_StVenantKirchhoff:
      YOUNG: 100
      NUE: 0.2
      DENS: 1
FUNCT1:
  - SYMBOLIC_FUNCTION_OF_TIME: a
  - VARIABLE: 0
    NAME: a
    TYPE: linearinterpolation
    NUMPOINTS: 3
    TIMES: [0, 1, 9.999999999e+09]
    VALUES: [1, 1.13, 1.13]
FUNCT2:
  - COMPONENT: 0
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: a
  - VARIABLE: 0
    NAME: a
    TYPE: linearinterpolation
    NUMPOINTS: 3
    TIMES: [0, 1, 9.999999999e+09]
    VALUES: [0, 1, 1]
